  Cash and Cash Equivalents = 2,339,224.10 + 4,292,000.00 = 6,631,224.10

Step 2: Identify the current debt. The “Total Current Liabilities” is given as 631,880.98.

Step 3: Calculate the Cash to Current Debt Ratio.
  Cash to Current Debt Ratio = (Cash and Cash Equivalents) / (Total Current Liabilities)
  = 6,631,224.10 / 631,880.98 ≈ 10.49

